import { useTimeout } from "../CustomHooks/useTimeOut";

export default function TimeOutHook(){

    const isReady = useTimeout(5000)
    return (
      <div>
        <h3> Custom Hooks </h3>

        {isReady && <h1 style={{color:"green"}}>Ready</h1>}
        {!isReady &&  <h1 style ={{color:"red"}}> NOT Ready </h1>}
      </div>
    );
  };
